-- VOLTAR LANÇAMENTOS EXCLUIDOS (Financeiro-Contabil)--Campos Flags de Contabilização--SE1 - Contas a Receber--E1_LA - Títs. a Receber--Ident. Lanc.	Identificador de LASelect E1_LA,* From SE1010Where E1_FILIAL = 'BA' and E1_FILORIG = 'BA01' and E1_NUM =  '000023953' and E1_PREFIXO = '2'and D_E_L_E_T_ = '*'--SE2 - Contas a Pagar--E2_LA - Títs. a Pagar--Ident. Lanc.	Identificador de LA .Select E2_LA, * From SE2010Where E2_FILIAL = 'BA' and E2_FILORIG = 'BA01' and E2_NUM = '' and E2_PREFIXO = '2'and D_E_L_E_T_ = '*'--SE5 - Movimentacao Bancaria--E5_LA - Mov. Bancário--Ident.L.A.	Ident.Lanc/Depos ChequeSelect E5_LA, * From SE5010Where E5_FILIAL = 'BA' and E5_FILORIG = 'BA01' and E5_NUMERO = '000023953' and E5_PREFIXO = '2'and D_E_L_E_T_ = '*'--SEU - Movimentos do Caixinha--*Tabela não usada --EU_LA - Mov. Caixinha Fin.--Ident. Lanc.	Identificador de LASelect EU_LA, * From SEU010Where EU_FILIAL = 'BA' and EU_FILORI = 'BA01' and EU_NUM = '000023953'and D_E_L_E_T_ = '*'--SEI - Movimento Aplicacao/Emprestimo--*Tabela não usada --EI_LA - Aplic./Emprest. Fin.--Ident.L.A.	Ident. Lanc. AutomaticoSelect EI_LA, * From SEI010Where EI_FILIAL = 'BA' and EI_NUMERO = '000023953' and EI_PARCELA = '2'and D_E_L_E_T_ = '*'--SEV - Multiplas Naturezas por Titulo--*Tabela não usada --EV_LA - Mult. Natureza-- Ident. Lanc.	Identificador de LA .Select EV_LA,* From SEV010Where EV_FILIAL = 'BA' and EV_NUM = '000023953' and EV_PREFIXO = '2'and D_E_L_E_T_ = '*'--SEZ - Distrib de Naturezas em CC--*Tabela não usada --EZ_LA - Mult.Natureza x C.Custo--Ident. de LA	Ident. de LASelect EZ_LA,* From SEZ010Where EZ_FILIAL = 'BA' and EZ_NUM =  '000023953' and EZ_PREFIXO = '2'and D_E_L_E_T_ = '*'--SEF - Cheques--EF_LA - Cheques--Ident. Cont.	Identificador de Contab.Select EF_LA,* From SEF010Where EF_FILIAL = 'BA'and EF_NUM = '000023953' and EF_PREFIXO = '2'and D_E_L_E_T_ = '*'--SF3 - Livros Fiscais--F3_DTLANC - Livros Fiscais--Dt. lancto.	Data do lancto contabilSelect F3_DTLANC,* From SF3010Where F3_FILIAL = 'BA' and F3_NFISCAN =  '000023953' and F3_SERIE = '2'and D_E_L_E_T_ = '*'--SF2 - Cabecalho das NF de Saida--F2_DTLANC - NFs  Saída--Dt. do Lanc.	Data do Lanc. Contab.Select F2_DTLANC,* From SF2010Where F2_FILIAL = 'BA' and F2_DOC =  '000023953' and F2_SERIE = '2'and D_E_L_E_T_ = '*'--SF1 - Cabecalho das NF de Entrada--F1_DTLANC - NFs Entrada-- Dt.Lancto	Data de LancamentoSelect F1_DTLANC,* From SF1010Where F1_FILIAL = 'BA' and F1_DOC =  '000023953' and F1_SERIE = '2'and D_E_L_E_T_ = '*'